    "2013-03-16T00:07:29.303424",nt"name": "geology-of-washington-1978",nt"isopen":
    false,nt"url": null,nt"notes": "Geology of Washington, Reprint 12, 1978.
    Washington is familiarly known as the Evergreen State, but itnmight as aptly be
    termed the Land of Contrast. Within the State, rainfall varies from more than 200
    inches annually in the Olympic Mountains to less than 10 inches in parts of eastern
    Washington. The lush forests of northern and western Washington contrast sharply
    with the barren, forbidding scablands of central Washington and the treeless wheat
    fields of the Palouse Hills; the towering, rugged Cascades contrast with the coulees
    and flat, basalt-covered mesas of central Washington and the level farmlands in
    the Pugel Lowlands north of Seattle; the snow-capped volcanoes that crown the Cascades
    con trast with the magnificent. beaches that stretch for miles along the Pacific
    Coast.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
